import React, { useState, useRef } from 'react';
import '../styles/PropertyListings.css';
import { FiMapPin, FiHome, FiLayers, FiDroplet, FiTrendingDown, FiTrendingUp, FiClock, FiChevronLeft, FiChevronRight } from 'react-icons/fi';

const PropertyListings = () => {
  const properties = [
    {
      id: 1,
      image: 'https://images.unsplash.com/photo-1564013799919-ab600027ffc6',
      price: '$579,000',
      beds: 2,
      baths: 1,
      sqft: 1419,
      status: 'Active',
      address: '9 Edgemere Rd, West Roxbury, MA 02132',
      mlsId: 'MAS D #73362931',
      agent: 'Coldwell Banker Realty - Hull, Ruth Mullin',
      daysOnMarket: 7,
      priceChange: {
        amount: '$40,000',
        date: '4/22',
        direction: 'down'
      }
    },
    {
      id: 2,
      image: 'https://images.unsplash.com/photo-1512917774080-9991f1c4c750',
      price: '$519,000',
      beds: 2,
      baths: 1,
      sqft: 826,
      status: 'Active',
      address: '104-104 Homes Ave #R, Dorchester, MA 02122',
      mlsId: 'MAS D #73350986',
      agent: 'Kelley & Nege Properties, Inc., Kevin Grogan',
      daysOnMarket: 0,
      priceChange: null
    },
    {
      id: 3,
      image: 'https://images.unsplash.com/photo-1493809842364-78817add7ffb',
      price: '$549,000',
      beds: 4,
      baths: 1,
      sqft: 1636,
      status: 'Active',
      address: '131 Russell Rd, West Roxbury, MA 02132',
      mlsId: 'MAS D #73363336',
      agent: 'Lamacchia Realty, Inc., Nicole Vermillion',
      daysOnMarket: 6,
      priceChange: {
        amount: '$20,000',
        date: '4/20',
        direction: 'up'
      }
    },
    {
      id: 4,
      image: 'https://images.unsplash.com/photo-1502672260266-1c1ef2d93688',
      price: '$449,900',
      beds: 2,
      baths: 1,
      sqft: 936,
      status: 'Active',
      address: '1 Glenwood Ave, Hydeville, VA 23130',
      mlsId: 'MAS D #7335179',
      agent: 'Vogt Realty, Inc., Nancy Vermillion',
      daysOnMarket: 33,
      priceChange: null
    },
    {
      id: 5,
      image: 'https://images.unsplash.com/photo-1522708323590-d24dbb6b0267',
      price: '$689,000',
      beds: 3,
      baths: 2,
      sqft: 1850,
      status: 'Active',
      address: '22 Park Lane, Boston, MA 02115',
      mlsId: 'MAS D #73364567',
      agent: 'Boston Realty Group, John Smith',
      daysOnMarket: 14,
      priceChange: {
        amount: '$15,000',
        date: '4/18',
        direction: 'down'
      }
    },
    {
      id: 6,
      image: 'https://images.unsplash.com/photo-1580587771525-78b9dba3b914',
      price: '$759,000',
      beds: 4,
      baths: 2.5,
      sqft: 2200,
      status: 'Active',
      address: '45 Beacon Street, Boston, MA 02108',
      mlsId: 'MAS D #73365543',
      agent: 'Luxury Homes Inc., Sarah Johnson',
      daysOnMarket: 21,
      priceChange: null
    }
  ];

  const [currentIndex, setCurrentIndex] = useState(0);
  const [showAll, setShowAll] = useState(false);
  const propertiesContainerRef = useRef(null);

  const nextSlide = () => {
    setCurrentIndex((prevIndex) => 
      prevIndex + 1 <= properties.length - getVisibleCount() ? prevIndex + 1 : 0
    );
  };

  const prevSlide = () => {
    setCurrentIndex((prevIndex) => 
      prevIndex - 1 >= 0 ? prevIndex - 1 : properties.length - getVisibleCount()
    );
  };

  const getVisibleCount = () => {
    const width = window.innerWidth;
    if (width < 480) return 1;
    if (width < 768) return 2;
    if (width < 992) return 3;
    return 4;
  };

  const toggleShowAll = () => {
    setShowAll(!showAll);
    setCurrentIndex(0);
  };

  const visibleProperties = showAll 
    ? properties 
    : properties.slice(currentIndex, currentIndex + getVisibleCount());

  return (
    <section className="property-listings">
      <div className="listings-header">
        <h2 className="listings-title">Homes For You in Boston, MA</h2>
        <p className="listings-subtitle">Based on homes you recently viewed</p>
        {!showAll && (
          <button className="view-all-btn" onClick={toggleShowAll}>
            View All Properties
          </button>
        )}
      </div>
      
      <div className="properties-container" ref={propertiesContainerRef}>
        {!showAll && (
          <button className="nav-btn prev-btn" onClick={prevSlide}>
            <FiChevronLeft />
          </button>
        )}
        
        <div className={`properties-grid ${showAll ? 'show-all' : ''}`}>
          {visibleProperties.map(property => (
            <div key={property.id} className="property-card">
              <img 
                src={property.image} 
                alt={property.address} 
                className="property-image"
              />
              <div className="property-badge">{property.status}</div>
              
              <div className="property-details">
                {property.daysOnMarket > 0 && (
                  <span className="days-on-market">
                    <FiClock /> {property.daysOnMarket} days on market
                  </span>
                )}
                
                {property.priceChange && (
                  <div className={`price-change ${property.priceChange.direction}`}>
                    {property.priceChange.direction === 'down' ? (
                      <FiTrendingDown />
                    ) : (
                      <FiTrendingUp />
                    )}
                    Price {property.priceChange.direction === 'down' ? 'cut' : 'increase'}: {property.priceChange.amount} ({property.priceChange.date})
                  </div>
                )}
                
                <div className="property-price">{property.price}</div>
                <div className="property-address">
                  <FiMapPin /> {property.address}
                </div>
                
                <div className="property-meta">
                  <span><FiHome /> {property.beds} bds</span>
                  <span><FiDroplet /> {property.baths} ba</span>
                  <span><FiLayers /> {property.sqft.toLocaleString()} sqft</span>
                </div>
                
                <div className="property-agent">
                  {property.mlsId}, {property.agent}
                </div>
              </div>
            </div>
          ))}
        </div>
        
        {!showAll && (
          <button className="nav-btn next-btn" onClick={nextSlide}>
            <FiChevronRight />
          </button>
        )}
      </div>
      
      {showAll && (
        <button className="view-all-btn" onClick={toggleShowAll}>
          Show Less
        </button>
      )}
    </section>
  );
};

export default PropertyListings;
